import React, {useEffect, useState} from "react";

function Items(){
    const [items, setItems] = useState([])

    useEffect(() => {
        fetch("http://localhost:3000/items")
            .then(resp => resp.json())
            .then(data => setItems(data))
    }, [])

    console.log(items)

    return <h1>ITEMS</h1>
}

export default Items
